import React, { Component } from "react";
// import SecureCallService from "./patientaxios";
import '../patient/add.css'
class Addproduct extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <>
      <div align='right'>
      <div>
        <form class="calculator card" style={{width:1089}}>
               <h3 align='center'>Register New Patient </h3>  
                <label >PTID</label>
                <input type="text"  placeholder="Patient Id" />
                <label >Patient Name</label>
                <input type="password" placeholder="Password" />
                <label >Address</label>
                <input type="text"  placeholder="1234 Main St" />
                <label >Address 2</label>
                <input type="text" placeholder="Apartment, studio, or floor" />
                <label >City</label>
                <input type="text"  />
                <label >State</label>
                <select  >
                  <option selected>Choose...</option>
                  <option>...</option>
                </select>
                <label >Zip</label>
                <input type="text" />
                <input  type="checkbox"  />
                <label >
                  Check me out
                </label>
               <button type="submit" class="btn btn-primary">Sign in</button>
          </form>
      </div>
      </div>
      </>

    );
  }
}

export default Addproduct;
